import React from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
  class Control {
    private state: any;
  }
  interface SelectableControl extends Control {
    select(): void;
  }
  // 错误：“Image”类型缺少“state”属性。
  class Image implements SelectableControl {
    select() {}
  }
  return <div className="App">11</div>;
}

export default App;
